import { Card, Button } from "react-bootstrap";

export default function CardHospedagem() {
  return (
    <Card style={{ width: "18rem" }}>
      <Card.Img variant="top" src="https://a0.muscache.com/im/pictures/5ac70395-9dc0-47f3-b9d6-6d3df4b90591.jpg?im_w=1440" />
      <Card.Body>
        <Card.Title>Título da Hospedagem</Card.Title>
        <Card.Text>
          Descrição da Hospedagem.
        </Card.Text>
        <Button variant="primary">Reservar</Button>
      </Card.Body>
    </Card>
  );
}
